import styled from "styled-components";

const Footer = () => {
  return <Producted>Producted by I5E2</Producted>;
};

let Producted = styled.div`
  width: 100vw;
  text-align: right;
  font-family: "Paprika";
  margin: 35px 70px 25px auto;
  padding-right: 70px;
  font-size: 20px;
`;

export default Footer;
